import React from "react";
import Countdown from "react-countdown";

const Countdownn = () => {
  return (
    <>
      {/* <Countdown date={Date.now() + 10000000} /> */}
      <Countdown
        date={Date.now()}
        renderer={(props) => (
          <div>{(props.days, props.minutes, props.seconds)}</div>
        )}
      />
    </>
  );
};

export default Countdownn;
